import React from "react";

class LikesCounter extends React.Component {
  render() {
    const getLikeNumbers = function () {
      props.handleClick();
    };

    return (
      <>
        <input type="button" value="DALE LIKE!!" onClick={getLikeNumbers} />
        <p>
          {props.stateNumber}
          <i className="fas fa-heart"></i>
        </p>
      </>
    );
  }
}

export default LikesCounter;
